import React from 'react';
import './Events.css'; 

const Events = () => {
  return (
    <div>
      <h1>Events Page</h1>
      <p>Welcome to the Events page!</p>

      <iframe src="https://calendar.google.com/calendar/embed?height=600&wkst=1&ctz=America%2FLos_Angeles&showPrint=0&src=YWNtdy5zY3VnaXJsc0BnbWFpbC5jb20&color=%230083c6" style="border:solid 1px #777" width="800" height="600" frameborder="0" scrolling="no"></iframe>
    </div>
  );
};

export default Events;
